import React from "react";
import { Icon } from "semantic-ui-react";

const Header = () => {
  return (
// center the header
<div class="ui secondary  menu">
  <a class="item">
    Home
  </a>
  <a class="item">
    Messages
  </a>
  <a class="item active">
    Friends
  </a>
  <div class="right menu">
    <div class="item">
      <div class="ui icon input">

        <i class="search link icon"></i>
      </div>
    </div>
    <a class="ui item">
      Logout
    </a>
  </div>
</div>

  );
}

export default Header;
